import React, { Component } from "react";
import { Row, Col, Card, Button, Icon, Progress,Table } from "antd";

import LineChart from "./LineChart";
import BarChart from "./BarChart";
import VerticalChart from "./VerticalChart";
const DataSet = require("@antv/data-set");



class ManagementAllCharts extends Component {
  constructor(props) {
    super(props);
    this.state = {
      chartData: [],
      selectedKey: "daily"
    };

  }
  render() {
    return (
      <div>
        <div id="content">
          <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:12, order: 5}} className="c-mb">
              <Card
                title="Line Chart"
                style={{ minHeight: "100%" }}
                bordered={false}
                className="mi-card mi-card-header-borderless mi-card-boxshadow" >
                <div>
                  <LineChart />
                </div>
              </Card>
            </Col>

            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:12, order: 5}} className="c-mb">
              <Card
                title="Bar Chart"
                style={{ minHeight: "100%" }}
                bordered={false}
                className="mi-card mi-card-header-borderless mi-card-boxshadow" >
                <div>
                  <BarChart />
                </div>
              </Card>
            </Col>
          </Row>

          <Row type="flex" gutter={24}>
            <Col xs={24} sm={24} md={{span: 12, order: 4}} lg={12} xl={{span:12, order: 5}} className="c-mb">
              <Card
                title="Vertical Chart"
                style={{ minHeight: "100%" }}
                bordered={false}
                className="mi-card mi-card-header-borderless mi-card-boxshadow" >
                <div>
                  <VerticalChart />
                </div>
              </Card>
            </Col>


          </Row>


          <Row type="flex" gutter={24}>
          </Row>

        </div>
      </div>
    );
  }
}
export default ManagementAllCharts;
